import React from 'react'
import Dot from "./Dot";
import "../style.css";

export default function Container(props) {
    var grid = [];
    var keyCount=1;
    let i;
    let rowCount = props.row+1;
    (function createBoard(){
        console.log("here too");
        if(props.row%2==0){
            for(i=0; i<9; ++i){
                grid.push(<Dot 
                                key={keyCount++} 
                                elementName={i%2==0?"dot":"horizontal-bar"}
                                elementId={i%2==0?"dot-"+rowCount+"-"+keyCount:"horizontal-bar-"+rowCount+"-"+keyCount}
                            />)
            }   
        }
        else{
            for(i=0; i<5; ++i){
                grid.push(<Dot
                                key={keyCount++}
                                elementName="vertical-bar"
                                elementId={"vertical-bar-"+rowCount+"-"+keyCount}
                            />)
            }
        }
    })()

    return (
        <div className={props.containerName} id={props.containerId}>{grid}</div>
    )
}
